import React from 'react';
import styled from 'styled-components';

const Header = props => {
  return (
    <headerMain >
      <h1>MERN Shop</h1>
    </headerMain>
  );
};

const headerMain = styled.header`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 4.5rem;
  display: flex;
  justify-content: center;
  align-items: center;
  background: #0028ab;
`



export default Header;
